import {fontSize, fonts, colors} from '../../styles/typography';
import {StyleSheet} from 'react-native';

const Styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.white,
    marginTop: 60,
    paddingHorizontal: 18,
  },
  space_3: {
    height: 3,
    backgroundColor: colors.background,
  },
  container_2: {
    paddingHorizontal: 18,
    flex: 1,
    backgroundColor: colors.white,
    paddingTop: 10,
  },
  rowFlex: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  txtTitle: {
    fontFamily: fonts.bold,
    fontSize: 20,
    color: colors.black,
    fontWeight: 'bold',
  },
  imgStyles: {
    width: 30,
    height: 30,
  },
  viewFlex: {
    flexDirection: 'row',
    paddingBottom: 10,
  },
  img2Styles: {
    flex: 1,
    alignItems: 'center',
  },
  boxStyles: {width: 60, height: 60},
  txtBox:{
    fontFamily: fonts.normal,
    fontSize: 14,
    color: colors.black,
  },
  
});
export default Styles;
